import { render } from "@testing-library/react";
import { Route } from "react-router-dom";
import App from "./App";
import IQVIA from "./IQVIA";

function Routing(){
    render(
        <Routes>
            <Route path="/" element={<App></App>}></Route>
            <Route path="/IQVIA" element={<IQVIA></IQVIA>}> </Route>
        </Routes>
    )
}
